import React from 'react';
import TotalChart from './components/chart/TotalChart';
import SendReport from './components/buttons/SendReport';
import MoodCheck from './components/buttons/MoodCheck';
import AwaitingTable from './components/tables/AwaitingTable';
import BlockedTable from './components/tables/BlockedTable';

function App() {
  return (
    <div style={{ display: 'flex', backgroundColor: '#f0f0f0', height: '100vh' }}>
      <div style={{ flex: '1', padding: '20px' }}>
        <div style={{ border: '1px solid black', borderRadius: '10px', padding: '10px', marginBottom: '20px' }}>
          <TotalChart/>
        </div>
        <div style={{ border: '1px solid black', borderRadius: '10px', padding: '10px', marginBottom: '20px' }}>
          <SendReport/>
        </div>
        <div style={{ border: '1px solid black', borderRadius: '10px', padding: '10px' }}>
          <MoodCheck/>
        </div>
      </div>

      <div style={{ flex: '1', padding: '20px' }}>
        <div style={{ marginBottom: '20px', border: '1px solid black', borderRadius: '10px', padding: '10px' }}>
          <h2>Awaiting Client Approval Issues</h2>
          <AwaitingTable/>
        </div>
        <div style={{ border: '1px solid black', borderRadius: '10px', padding: '10px' }}>
          <h2>Blocked Issues</h2>
          <BlockedTable/>
        </div>
      </div>
    </div>
  );
}

export default App;
